function empty(e){return!e||0===e.length}function escapeHtml(e){return e.replace(/&/g,"&amp;").replace(/</g,"&lt;").replace(/>/g,"&gt;").replace(/"/g,"&quot;").replace(/'/g,"&#039;")}function FileSizeConvert(e,t){if(0==e)return"0 Byte";var r=t||3,n=["Bytes","KB","MB","GB","TB","PB","EB","ZB","YB"],a=Math.floor(Math.log(e)/Math.log(1e3));return parseFloat((e/Math.pow(1e3,a)).toFixed(r))+" "+n[a]}function isInt(e){return e%1==0}function isJSON(e){return/^[\],:{}\s]*$/.test(e.replace(/\\["\\\/bfnrtu]/g,"@").replace(/"[^"\\\n\r]*"|true|false|null|-?\d+(?:\.\d*)?(?:[eE][+\-]?\d+)?/g,"]").replace(/(?:^|:|,)(?:\s*\[)+/g,""))}function openInNewTab(e){var t=window.open(e,"_blank");return t.focus(),t}function round(e,t){var r=Math.pow(10,t);return Math.round(e*r)/r}Math.root=function(e,t){var t=t||2;return Math.pow(e,1/t)};
